import React from 'react'
import Fragment from 'render-fragment';

export default class FixedRoster extends React.Component {
    constructor() {
        super();
        this.state = {
            userCourses: this.props.data
        }
    }

    render() {
        return(
            <Fragment>
                {this.state.userCourses.map(function(d, idx){
                    return (<li key={idx}>{d.name}</li>)
                })}
            </Fragment>

        )
    }
}
